American Daydreams - Jessica Lynn

Danny always had a crush on Jessica Lynn all through school but never got up the nerve to talk to her. When he falls asleep looking at old pictures of classmates, he slips into a sweet dream where Jessica wakes him up with a kiss and leaves him sleeping after some night-time nookie...
